import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 46.2-827 Right-of-way of United States forces, troops, National Guard, etc.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-827.md","filePath":"vacode/46.2-827.md"}'),r={name:"vacode/46.2-827.md"},i=o('<h1 id="§-46-2-827-right-of-way-of-united-states-forces-troops-national-guard-etc" tabindex="-1">§ 46.2-827 Right-of-way of United States forces, troops, National Guard, etc. <a class="header-anchor" href="#§-46-2-827-right-of-way-of-united-states-forces-troops-national-guard-etc" aria-label="Permalink to &quot;§ 46.2-827 Right-of-way of United States forces, troops, National Guard, etc.&quot;">​</a></h1><p>United States forces or troops, or any portion of the Virginia National Guard, parading or performing any duty according to law, or any civil defense personnel performing any duty according to law, shall have the right-of-way in any highway through which they may pass. Such passage, however, shall not interfere with the carrying of the United States mails and the legitimate functions of police and fire fighters or with the passage of emergency vehicles as defined in § <a href="http://law.lis.virginia.gov/vacode/46.2-920/" target="_blank" rel="noreferrer">46.2-920</a>.</p><p>Code 1950, § <a href="http://law.lis.virginia.gov/vacode/44-101/" target="_blank" rel="noreferrer">44-101</a>; 1958, c. 541, § 46.1-224; 1989, c. 727; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0221" target="_blank" rel="noreferrer">221</a>.</p>',3),n=[i];function s(c,d,f,h,l,g){return a(),t("div",null,n)}const u=e(r,[["render",s]]);export{_ as __pageData,u as default};
